    value: Schedule B, Line 21(b) reports reimbursements for travel expenses which
      are not itemized because they do not exceed the $200 itemization level and do
      not exceed the $200 aggregate per vendor amount.  With respect to the expenditures
      made by the Party for payroll, payroll taxes, and other payroll or employee
      benefit-related expenses, the Party adheres to 11 CFR 300.33, and also follows
      the Commissions revision of the rules as adopted on December 1, 2005. Specifically,
      the Party pays for these costs with 100% federal funds when the employee spends
      more than 25 percent of his or her time in a month on federal election activity
      (FEA) or activity in connection with a federal election. These expenditures
      are reported on Schedule B for Line 30b.  Alternatively, when an employee does
      not meet the 25 percent threshold, the Party allocates these costs as an overhead/administrative
      expense, and reports these disbursements on a Schedule H4 for Line 21a.  On
      Schedule F, the software required the entry of  UN- in the purpose field in
      order for an X to appear in the No box with respect to the designation by another
      political party.   Requests for reattribution/redesignation have been made for
      contributions exceeding federal limits.  The reattribution memo entry which
      appears on Page 32, block C, to Mrs. Charlotte Franklin is a reattribution from
      Mr. Larry Franklin, spouse, whose original contribution was disclosed on the
      Year End 2007 Report as a memo entry transaction on Line 12 in connection with
      the transfer from the Cornyn-Texas Victory Committee.
